css:
.highlight.linter-warning .region {
  background: linear-gradient(to bottom, #ffff58 0%, rgba(255, 255, 88, 0.30000000000000004) 20%, rgba(255, 255, 88, 0.30000000000000004) 80%, #ffff58 100%);
  border-left: 2px solid #ffff58;
  border-right: 2px solid #ffff58;
}
.highlight.linter-error .region {
  background: linear-gradient(to bottom, #ff5858 0%, rgba(255, 88, 88, 0.30000000000000004) 20%, rgba(255, 88, 88, 0.30000000000000004) 80%, #ff5858 100%);
  border-left: 2px solid #ff5858;
  border-right: 2px solid #ff5858;
}
